class seri_14:
    ad = "Hajirau Kimi ga Mitainda"
    desc = "Babası film yönetmeni olan lise öğrencisi Akito Shirasawa, bir gün kütüphanenin malzeme odasında bir şey görürü. Bu okuldan bir öğrenci olan Natsuho Hounjou'nun 'Mastürbasyon Yaparken'ki görüntüsüdür. Başta afallasa da sonunda videoya çeker. Natsuho, Akito'yu fark eder ve erkekler tuvaletinde ona bir 'teklif' yapar! Yakalanan liseli bir kız ve onu videoya çeken çocuk. Ergenlikle birleşen 'açığa çıkan' sapkın aşk başlıyor!"
    image = "https://athenafansub.com/wp-content/uploads/2022/08/1660734530-3264-i391547.jpg"
    url = "https://athenafansub.com/manga/hajirau-kimi-ga-mitainda/"
class seri_15:
    ad = "Isekai Yakkyoku"
    desc = "Dünyaca ünlü tıp araştırmacısı Kanji Yakutani, küçük kız kardeşini tedavisi olmayan bir hastalıktan kaybettikten sonra, hayatını yeni ilaçlar icat etmeye adayarak hastaları iyileştirmek için her şeyini verdi. 31 yaşında ölümüne çalıştıktan sonra, eski eczacı, vücuduna yıldırım çarpmış 10 yaşında bir çocuk olarak uyanır. Saygın De Médicis ailesinin bir çocuğu olan Falma olarak bir ortaçağ dünyasına reenkarne olduğunu keşfeder. İlahi sanatların -koruyucu tanrıların kutsamalarıyla bahşedilen sihrin- var olduğu bir dünyada, Falma, vücudunun koruyucu tıbbın tanrısına ev sahipliği yaptığını fark eder. Çocuğa, efsanevi ilahi yaratma ve indirgeme sanatlarının yanı sıra insanların vücutlarındaki hastalıkları anında teşhis etme yeteneği verildi. Çok geçmeden bu dünyadaki tıbbın korkunç durumunu keşfeder: En iyi ihtimalle etkisiz ve en kötü ihtimalle zararlı olan tıbbi bakımı yalnızca soylular karşılayabilir. Modern bilgiyi ve ilahi güçlerini kullanan Falma, genç yaşına rağmen yavaş yavaş bir eczacı olarak isim yapar, hatta imparatorluk mahkemesinin tanınmasını bile kazanır. Sonunda kendine uygun bir eczane edindiğinde, San Fleuve İmparatorluğu'ndaki sağlık hizmetlerini iyileştirme ve herkes için erişilebilir hale getirme hedefini sürdürmeye karar verir."
    image = "https://athenafansub.com/wp-content/uploads/2022/08/1660734646-9419-i381651.jpg"
    url = "https://athenafansub.com/manga/isekai-yakkyoku/"
