class seri_17:
    ad = "Kimi wa Meido-sama"
    desc = "Hizmetçi üniformalı bir kız iş aramak için Hitoyoshi’nin evine geldi. Önceki işinde bir suikastçıydı ve tüm ölümcül dövüş sanatlarında yetenekli, ancak ev işlerinde tam bir acemi. Hitoyoshi’nin bu garip istek karşısında kafası karıştı ve onu reddetti. Ama sonra Hitoyoshi’yi ölümcül bir kazadan kurtardı ve Hitoyoshi bunu becerebileceklerini düşündü. Bu, soğuk kalpli bir katil olan ve yeni duygular öğrenen bir hizmetçi hakkında bir hikaye. Yeraltı dünyasında yalnız bir hayat yaşayan bir hizmetçi sonunda ailesini buluyor. Keyifli bir günlük yaşamın başlangıcı."
