class seri_20:
    ad = "Osananajimi to wa Romcom ni Naranai"
    desc = "Liseli bir çocuk olan Eiyuu'nun (A.U.) bir sorunu var! Onunla aynı liseye giden iki çocukluk arkadaşı 'Shio' ve 'Akari' çok tatlılar! Büyüdüklerine göre onlara cinsel olarak bakan tek kişinin ben olduğumu öğrenirlerse, buna hiç niyetim olmasa da... bu çok fazla olur! Öte yandan iki çocukluk arkadaşının da kendi sırları var...? Bu çok garip! Karmaşık! Ama çocukluk arkadaşları en iyisidir! Dürüst olamayacağınız tatlı ve sabırsız bir aşk üçgeni aşk komedisi!"
