    desc = "Bir okuldaki üç çiftin saçmalıkları hakkında. Hikaye esas olarak büyük göğüsler, biraz beceriksiz Enokida ile küçük, biraz garip Sibakusa arasında değişiyor. Anlatım bazen doğrusal bir çizgide ilerlemeyebilir."
