class seri_22:
    ad = "The Baby Land Lord Is Retiring"
    desc = "Üçüncü hayatında, kan ve gözyaşı olmayan bir kötü adamın tek kızı olarak yeniden doğdu. İnsanlar yıkılmak üzere olan bir evde yaşıyordu, bu yüzden önceki hayatındaki bilgileri kullanarak bir bina tasarladı. Ancak babası onu yakaladı ve - 'Binanın mülkiyetinin binanın inşaatını organize eden kişiye verileceğine dair bir yasa tasarısı çıkardık.' Büyük bir binanın sahibi oldu. Biraz rüşvet toplayalım ve emekli olalım! “Bayan beni acıkmaktan kurtardı!” 'Leydim sayesinde sıcacık, yeni bir evde uyuyabilirim!' “Herkesin genç istihdam oranı keskin bir şekilde arttı!” Ne yaptım? Herkesin beni bu kadar övmesi o kadar büyük bir şey mi? İşleri daha da kötüleştirmek için babam evden kaçma planımı öğrendi... 'Neyi yanlış yaptım? her şeyi düzelteceğim, bu yüzden ayrılma.' “T-bu değil…….” 'Sana istediğin her şeyi vereceğim. Oh, değil mi, imparatorun oğlu seni rahatsız etmedi mi? İmparatorun boynunu da kesebilirim, ne dersin?” Sonra, maviden bir cıvata gibi, bir savaş başlatmayı düşündü. 'Neden daha fazla iş alıyorum?' ...G-Güvenle emekli olabilir miyim? (NU'dan alınmıştır)"
    image = "https://athenafansub.com/wp-content/uploads/2022/08/ecba980a554b953929141ac118117dc5.jpg"
    url = "https://athenafansub.com/manga/the-baby-land-lord-is-retiring/"
class seri_23:
    ad = "The Fox’s Trap"
    desc = "İnsan kız Chi Yan, her gün bir tilki kabusu görüyor ve bu hayat da bir istisna değil. Bir gün gerçek bir tilki iblisi ile tanışır. Dokuz kuyruklu tilki Yin Ran’ın sadece sekiz kuyruğu var. Chi Yan’a bağlı kuyruğu geri almak için onun dileklerinden birinin yerine getirilmesi gerekiyor. Ancak kızın hiçbir isteği yok ve sadece ondan kurtulmak istiyor. Kötü tilki, buna karşılık olarak hayatını alt üst eder. Kızın önünde sevimli bir yüz belirdi, “Şimdi bir dilek tutmak ister misin?”"
    image = "https://athenafansub.com/wp-content/uploads/2022/08/Basliksiz550_20220909115114.png"
    url = "https://athenafansub.com/manga/the-foxs-trap/"
class seri_24:
    ad = "The Story of an Onee-San Who Wants to Keep a High School Boy"
    desc = "Minoru Soramoto'nun ebeveynleri ağır bir borca girdikten ve onu kendi başının çaresine bakmak üzere bıraktıktan sonra, onu aynı zamanda komşusunun bakımına bıraktıklarını öğrenir - ona takıntılı, göz kamaştırıcı, korkak ve gizemli genç bir kadın. Kesin olan tek bir şey var: onu seviyor. Aslında ona tüm kalbiyle tapıyor, delicesine ve imkanlarının ötesinde… ama neden? Minoru bu kadar sevilmek için ne yaptı?!"
    image = "https://athenafansub.com/wp-content/uploads/2022/08/ae26b8b6-4f97-45e5-a711-8799d6ffb85a-1-1.jpg"
    url = "https://athenafansub.com/manga/the-story-of-an-onee-san-who-wants-to-keep-a-high-school-boy/"
class seri_25:
    ad = "Tokidoki Bosotto Roshiago de Dereru Tonari no Alya-san"
    desc = "Akıllı, zarif ve çarpıcı bir şekilde muhteşem, yarı Rus yarı Japon Alisa Mikhailovna Kujou, okulunun idolü olarak kabul ediliyor. Uzun gümüş rengi saçları, büyüleyici mavi gözleri ve son derece açık teniyle sayısız erkek öğrencinin kalbini kazanırken, diğerleri tarafından büyük beğeni topladı. Öyle olsa bile, görünüşte ulaşılmaz kişiliği nedeniyle, herkes neredeyse kusursuz kıza karşı dikkatli olmaya devam ediyor. Birkaç istisnadan biri, günlerini anime izleyerek ve gacha oyunları oynayarak geçiren nispeten ortalama bir çocuk olan Alisa'nın yedek arkadaşı Masachika Kuze. Kayıtsız tavrına rağmen Masachika, Alisa'nın dikkatini çeken tek öğrencidir. Tamamen dürüst olamayan Alisa, Masachika'ya karşı genellikle sert davranır ve sevgisini yalnızca Rusça olarak ifade eder. Ancak onun farkında olmadan, Masachika dili gerçekten anlıyor, ancak kendi eğlencesi için başka türlü davranıyor. Garip ikili esprili ve eğlenceli sözler söylemeye devam ettikçe ilişkileri giderek daha romantik ve keyifli hale gelir ve Alisa sonunda gerçek duygularını özgürce iletmeyi öğrenebilir."
    image = "https://athenafansub.com/wp-content/uploads/2022/08/roshidere.jpg"
    url = "https://athenafansub.com/manga/tokidoki-bosotto-russia-go-de-dereru-tonari-no-aalya-san/"

